import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from '../../services/api';
import StatsCard from '../../components/Landlord/StatsCard';

const LandlordDashboard = () => {
  const [stats, setStats] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [recentActivity, setRecentActivity] = useState([]);

  useEffect(() => {
    const fetchDashboardData = async () => {
      try {
        const [statsRes, activityRes] = await Promise.all([
          axios.get('/api/landlord/dashboard/stats'),
          axios.get('/api/landlord/dashboard/activity')
        ]);
        
        setStats(statsRes.data);
        setRecentActivity(activityRes.data);
      } catch (err) {
        setError(err.response?.data?.message || 'Failed to load dashboard data');
      } finally {
        setLoading(false);
      }
    };

    fetchDashboardData();
  }, []);

  if (loading) return <div>Loading dashboard...</div>;
  if (error) return <div className="error">{error}</div>;

  return (
    <div className="landlord-dashboard">
      <h1>Landlord Dashboard</h1>
      
      <div className="stats-grid">
        <StatsCard 
          title="Total Properties" 
          value={stats.totalProperties} 
          icon="üè†" 
          link="/landlord/properties"
        />
        <StatsCard 
          title="Active Listings" 
          value={stats.activeProperties} 
          icon="‚úÖ" 
          link="/landlord/properties?status=active"
        />
        <StatsCard 
          title="Pending Approval" 
          value={stats.pendingApproval} 
          icon="‚è≥" 
          link="/landlord/properties?status=pending"
        />
        <StatsCard 
          title="Proposals Received" 
          value={stats.totalProposals} 
          icon="üì©" 
          link="/landlord/proposals"
        />
        <StatsCard 
          title="Unread Messages" 
          value={stats.unreadMessages} 
          icon="üí¨" 
          link="/messages"
        />
      </div>

      <div className="quick-actions">
        <h2>Quick Actions</h2>
        <div className="actions-grid">
          <Link to="/landlord/properties/new" className="action-card">
            <div className="action-icon">‚ûï</div>
            <h3>Add New Property</h3>
          </Link>
          <Link to="/landlord/proposals" className="action-card">
            <div className="action-icon">üìã</div>
            <h3>View Proposals</h3>
          </Link>
          <Link to="/messages" className="action-card">
            <div className="action-icon">‚úâÔ∏è</div>
            <h3>Check Messages</h3>
          </Link>
          <Link to="/landlord/properties" className="action-card">
            <div className="action-icon">üèòÔ∏è</div>
            <h3>Manage Properties</h3>
          </Link>
        </div>
      </div>

      <div className="recent-activity">
        <h2>Recent Activity</h2>
        <div className="activity-list">
          {recentActivity.length > 0 ? (
            recentActivity.map((activity, index) => (
              <div key={index} className="activity-item">
                <p>{activity.message}</p>
                <span className="time">{new Date(activity.timestamp).toLocaleString()}</span>
              </div>
            ))
          ) : (
            <p>No recent activity</p>
          )}
        </div>
      </div>
    </div>
  );
};

export default LandlordDashboard;
